import React from "react";
import { withRouter } from "react-router-dom";

//UI
import {Dialog,DialogActions,DialogTitle,Button,Tooltip,Typography,AppBar,Card,CardHeader,IconButton,
  CircularProgress,Avatar,ListItemText,ListItem,Drawer,Divider,Collapse,Paper} from '@material-ui/core';
// import Alert from '@material-ui/lab/Alert';
// import {Close,Share,FileCopyOutlined, Refresh} from '@material-ui/icons';\
import { withStyles } from "@material-ui/core/styles";
import { styles } from "./UIComponents"
class Input extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        productList : ["Airpod"]
    };
  }

  render() {
    const {productList} = this.state
    const {classes} = this.props
    const date = new Date()
    return(
        <div className = {classes.root}>
            <AppBar className = {classes.appBar} style = {{backgroundColor : "#333333"}}>
                <img src= "https://pngimg.com/uploads/amazon/amazon_PNG5.png" width = "30px" height = "30px" className={classes.logo}></img>
                <Typography className={classes.name}>Purchase History</Typography>
            </AppBar>
            <div className ={classes.mappingItemContainer}>
                {productList.map((p,i) => (
                    <div key={i} className={classes.cardContainer}>
                        <Card variant="outlined" className={classes.card}>
                            <CardHeader className={classes.cardHead} 
                            title={p} 
                            subheader= {date.getFullYear()} >
                            </CardHeader>

                        </Card>
                        <span className={classes.breaker}></span>
                    </div>
                ))}
            </div>
        </div> 
    )
  }
}
export default withStyles(styles)(Input);
